import BubbleBox from "../Presenter/BubbleBox";
import MainChatLogPresenter from "../Presenter/MainChatLogPresenter";
import styled from "styled-components";

const Name = styled.p`
    position: absolute;
    left: 40px;
    top:25px;
    font-size:20px;
`

const Date = styled.p`
    position: absolute;
    left: 100px;
    top:30px;
    font-size:15px;
`

const Content = styled.p`
    position: absolute;
    left: 100px;
    top:30px;
    font-size:15px;
`

const MainChatLogContainer = () => {
    return (
        <MainChatLogPresenter>
            <BubbleBox>
                <Name>이상철</Name>
                <Date>5:23 PM</Date>
                <Content>안녕하세요 여러분~!</Content>
            </BubbleBox>
        </MainChatLogPresenter>
    )
}

export default MainChatLogContainer;
